import './Login.css'
function Login(){
   return(
      <div>
    
          <div>
              <img src='/Login-student.gif' ></img>
          </div>

          <div className="box">
             <div className="login">
               <img id='logo' src="/careersynclogo.svg" alt="CareerSync Logo" />
             </div>

          </div>
      </div>
   );
}

export default Login;
